    <View style={styles.container}>
      <SearchBar
        placeholder="Search"
        platform="ios"
      />
      <View>
        <Text style={styles.h1}>Your Lists</Text>
      </View>
      <View style={{marginTop: 10}}>
              <Button text="Sign out" onPress={()=>{
              try {
                 AsyncStorage.removeItem(
                  '@user_key'
                );
              } catch (error) {
                // Error saving data
              }

              }}/>
       </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "white",
  },
  h1: {
    color: "#389BF2",
    fontSize: 22,
    marginTop: 22,
    marginLeft: 36,
  },
});
